import React from 'react';
import './Button.css';
import PropTypes from 'prop-types';

const  Button = (props) => {
   const myClasses = `${props.cls.toString()} Btn`;
   return (
      <button
         type="button"
         className={myClasses}
         onClick={props.clicked}
      >
         {props.children}
      </button>
   )
};
Button.propTypes = {
   clicked: PropTypes.func.isRequired
};
export default Button;
